  namespace: UltraForce.Library.NetStandard.Models
  summary: >-
    <xref href="UltraForce.Library.NetStandard.Models.UFModelStorageWrapper" data-throw-if-not-resolved="false"></xref> can be used to create models that

    map their properties directly to a storage.

    <p>

    Use <xref href="UltraForce.Library.NetStandard.Models.UFModelStorageWrapper.Get%60%601(System.Func%7b%60%600%7d%2cSystem.String)" data-throw-if-not-resolved="false"></xref> to get a property value from the storage and

    use <xref href="UltraForce.Library.NetStandard.Models.UFModelStorageWrapper.Set(System.Object%2cSystem.String)" data-throw-if-not-resolved="false"></xref> to store a property value to the storage.

    </p>

    <p>

    The class handles properties that implement

    <xref href="UltraForce.Library.NetStandard.Interfaces.IUFNotifyDataChanged" data-throw-if-not-resolved="false"></xref>. The class uses 

    <xref href="UltraForce.Library.NetStandard.Models.UFModel.Option.TrackChildChange" data-throw-if-not-resolved="false"></xref> and

    will update the object in storage whenever it changes.

    </p>

    <p>

    If a property is a (sub)class of <xref href="UltraForce.Library.NetStandard.Models.UFModelStorageWrapper" data-throw-if-not-resolved="false"></xref> the

    class will call <xref href="UltraForce.Library.NetStandard.Models.UFModelStorageWrapper.SetParentKeyPrefix(System.String)" data-throw-if-not-resolved="false"></xref> whenever a new instance

    is created or assigned. The class will never store the value itself in

    the storage. The class assumes the property value will take care of

    storing/retrieving itself. This allows for a

    <xref href="UltraForce.Library.NetStandard.Models.UFModelStorageWrapper" data-throw-if-not-resolved="false"></xref> subclass to be used for multiple

    properties without key name conflicts.

    </p>

    <p>

    Properties that implement <xref href="UltraForce.Library.NetStandard.Storage.IUFStorableObject" data-throw-if-not-resolved="false"></xref> are treated

    slightly different. The first time a property's value is referenced

    and none exists, a new instance is created and its data is loaded

    from the wrapped <xref href="UltraForce.Library.NetStandard.Storage.UFKeyedStorage" data-throw-if-not-resolved="false"></xref> using

    <xref href="UltraForce.Library.NetStandard.Storage.UFKeyedStorage.GetStorableObject(System.String%2cUltraForce.Library.NetStandard.Storage.IUFStorableObject)" data-throw-if-not-resolved="false"></xref>.

    </p>
